import React from 'react';
import { Grid } from '@mui/material';

const ImagePost = ({title, body, datePosted, imageKey}) => {
    return (
        <Grid item xs={12} sm={6} md={4} lg={3} xl={2}>
            <div style={{border: '1px solid black', paddingBottom: 0}}>
                <h1>{title}</h1>
                <p>{body}</p>
                <img src={`http://localhost:8080/image/${imageKey}`} style={{maxHeight: '100%', maxWidth: '100%'}}/>
            </div>
        </Grid>
    )
}

export default ImagePost;
